 BiBi Jones, Selena Rose, Manuel Ferrara, Mick Blue, Erik Everhard, James Deen, Ella Milano, Kortney Kane

The Cool Crowd... Where The Sex Is Hot And The Girls Are Hotter!

Sexy college student Selena Rose knows all the right people and all the right parties. The place to be is at the Cool Guys' house, where Manuel Ferrara and his pal Erik Everhard live. To help her new classmate BiBi Jones out, Selena takes her over to the house for lots of fun and even more fucking. They meet the beautiful Kortney Kane after Manuel gives her a deep drilling with his hot rod. It's Erik who sets his sights on banging BiBi and after some begging, she gets him off to get rid of him. Party guy James Deen scores with stunning Ella Milano. Popular girl around the house, Selena, is always looking for a hook-up and Mick Blue gives her a hard pounding. Meanwhile Manuel falls for BiBi, and wants more than a one night stand.

